style.css:
@-moz-document url-prefix("https://web.whatsapp.com/") {
/* Fundo da página */
    body {
        background-color: #121212 !important;
        color: #e5e5e5 !important;
    }

    /* Barra lateral de contatos */
    ._2EZ_m {
        background-color: #1e1e1e !important;
    }

    ._3J6wB {
        background-color: #1e1e1e !important;
    }

    /* Borda das conversas */
    ._1Gy50 {
        border-color: #333333 !important;
    }

    /* Nomes dos contatos */
    ._3H4MS {
        color: #ffffff !important;
    }

    /* Mensagens de texto (enviadas) */
    .message-out {
        background-color: #056162 !important;
        color: #ffffff !important;
    }

    /* Mensagens de texto (recebidas) */
    .message-in {
        background-color: #262d31 !important;
        color: #ffffff !important;
    }

    /* Fundo da área de digitação */
    ._1UWac {
        background-color: #2a2f32 !important;
        color: #ffffff !important;
    }

    /* Texto do input de mensagem */
    .selectable-text {
        color: #e5e5e5 !important;
    }

    /* Título do chat ativo */
    ._21nHd {
        background-color: #2a2f32 !important;
        color: #ffffff !important;
    }

    /* Cabeçalho superior (barra de busca) */
    ._3auIg {
        background-color: #1e1e1e !important;
        color: #ffffff !important;
    }

    /* Fundo do chat */
    ._1_q7u {
        background-color: #121212 !important;
    }

    /* Ícones e botões */
    ._3ndVb path {
        fill: #ffffff !important;
    }

    /* Hora das mensagens */
    ._1qB8f {
        color: #b3b3b3 !important;
    }
}
